import React from "react";

const index = () => {
  return (
    <>
      <ul>
        <li>  Sum of two no is {add(30,5)}</li>
        <li>  Sub of two no is {sub(30,5)}</li>
        <li>Div of two no is {div(30,5)}</li>
        <li>Mult of two no is {mul(30,5)}</li>
      </ul>
    </>,
    document.getElementById("root")
  )
}

export default index
